import React from "react";
import ReactDOM from "react-dom";

function Note(props){
    return <div className="note">
        <h1>{props.title}</h1>
        <p>{props.desc}</p>
        <button onClick={props.func2}>DELETE</button>
    </div>
}
export  default Note;
